INSERT INTO `v1_35883b8ff1d1ca04b65ddcfa61fd518b16fdd0ce9a183390a26d44958d6578d7` VALUES (513048, 5, 0, "クウカはこんな新年早々に\n豪華な料理とたくさんの人の前で\nドSさんに弄ばれ辱めを……！\nぐふふ……ぐふふふふ。", 104511, 0, 0, 1, 11, 0.5, 513);
